import axios from 'axios'

const api = axios.create({
    baseURL: 'http://127.0.0.1:8000/',
});

export const login = async (email: string, password: string) => {
    try {
        const response = await api.post('/rest/v1/login/', {
            email: email,
            password: password
        });
        return response.data;
    } catch (error) {
        console.log(error);
        throw error;
    }
};
